    const friends =[
        {id:1,name:'Subhas'},
        {id:2,name:'Arko'},
        {id:3,name:'Arup'}
    ]
    return (
        <View>
            <Text>List Screen</Text>
        </View>
    )
}

export default ListScreen

const styles = StyleSheet.create({})
